import React from "react";
import "./HomeSections.css";

// ✅ Material UI Icons
import FacebookIcon from "@mui/icons-material/Facebook";
import TwitterIcon from "@mui/icons-material/Twitter";
import InstagramIcon from "@mui/icons-material/Instagram";
import LinkedInIcon from "@mui/icons-material/LinkedIn";
import { Button } from "@mui/material";

const HomeSections = () => {
  const cards = [
    { img: "https://via.placeholder.com/80", title: "Metric 1", subtitle: "Description 1" },
    { img: "https://via.placeholder.com/80", title: "Metric 2", subtitle: "Description 2" },
    { img: "https://via.placeholder.com/80", title: "Metric 3", subtitle: "Description 3" },
    { img: "https://via.placeholder.com/80", title: "Metric 4", subtitle: "Description 4" },
    { img: "https://via.placeholder.com/80", title: "Metric 5", subtitle: "Description 5" },
  ];

  return (
    <div className="home-sections">

      {/* Section 1 */}
      <section className="section-one">
        <div className="video-container">
          <video autoPlay loop muted>
            <source src="https://www.w3schools.com/html/mov_bbb.mp4" type="video/mp4" />
            Your browser does not support the video tag.
          </video>

          {/* Overlay Items */}
          <div className="overlay">
            <div className="enquiry">
              <Button variant="contained" color="warning">Enquiry</Button>
            </div>
            <div className="social-icons">
              <FacebookIcon />
              <TwitterIcon />
              <InstagramIcon />
              <LinkedInIcon />
            </div>
          </div>
        </div>
      </section>

      {/* Section 2 */}
      <section className="section-two">
        <h3 className="notice-title">Important Notice</h3>
        <marquee className="notice-text">
          This is a running text for important notice. Keep updated with the latest news!
        </marquee>
        <Button variant="contained" color="primary" className="apply-btn">
          Apply Now
        </Button>
      </section>

      {/* Section 3 */}
      <section className="section-three">
        <h1>Metrics of Innovation</h1>
        <h2>vhfvfdkjvhfhghgliwetg / werg / lkejgklejlhgitg</h2>

        <div className="cards-container">
          {cards.map((card, index) => (
            <div className="card" key={index}>
              <img src={card.img} alt={card.title} />
              <h1>{card.title}</h1>
              <h2>{card.subtitle}</h2>
            </div>
          ))}
        </div>
      </section>

    </div>
  );
};

export default HomeSections;
